import "./create.css";

export default function Create() {
  return (
    <div className="create">
      <form className="createForm">
        <div className="createFormGroup">
          <label htmlFor="fileInput" />
          <input type="file" id="fileInput" />
          <input type="text" placeholder="Title" />
        </div>
      </form>
    </div>
  );
}
